// 引用 crypto-js 加密模块
var CryptoJS = require('crypto-js')

function Decrtpya(text){
    var ne = CryptoJS.enc.Utf8.parse("efabccee-b754-4c");
    var re = text ;
    data = JSON.parse((re = text,
    CryptoJS.AES.decrypt(re, ne, {
        mode: CryptoJS.mode.ECB,
        padding: CryptoJS.pad.Pkcs7
    }).toString(CryptoJS.enc.Utf8).toString()));
    return data['articleDetail']['articleDetailData']['data']['widgetContent']
}
var ciphertext = ''
console.log(Decrtpya(ciphertext));
